"""
30. 串联所有单词的子串
给定一个字符串 s 和一个字符串数组 words。 words 中所有字符串 长度相同。
 s 中的 串联子串 是指一个包含  words 中所有字符串以任意顺序排列连接起来的子串。
例如，如果 words = ["ab","cd","ef"],
 那么 "abcdef",  "abefcd", "cdabef",  "cdefab", "efabcd",  和 "efcdab" 都是串联子串。 "acdbef" 不是串联子串，因为他不是任何 words 排列的连接。
返回所有串联子串在 s 中的开始索引。你可以以 任意顺序 返回答案。
超时实在解决不了了
"""

def check(s: str, words: list[str]) -> bool:
    res = False
    l = []
    step = len(words[0])
    for w in words:
        l.append(w)
    i = 0
    while i < len(s):
        if s[i: i+ step] in l:
            l.remove(s[i: i+ step])
        i = i + step
    return len(l) == 0

def findSubstring( s: str, words: list[str]) -> list[int]:
    res = []
    ret = False
    if len(words) and len(words[0]):
        windowsSize = len(words) * len(words[0]) 
        if windowsSize > len(s):
            return res
        outstr = ""
        instr = ""
        for i in range(0, len(s) - windowsSize + 1, len(words[0])):
            if i != 0:
                outstr = s[i - len(words[0]): len(words[0])]
            instr = s[i + windowsSize - len(words[0]): i + windowsSize]
            if instr == outstr : 
                if ret:
                    res.append(i)
                continue
            else:
                ret = check(s[i:i + windowsSize], words)
                if ret:
                    res.append(i)

    return res


